import UIKit

class StackedImages: UIStackView {
    private var iconScale: CGFloat = 0.70

    init(images: [UIImage], iconScale: CGFloat = 0.70) {
        self.iconScale = iconScale
        super.init(frame: .zero)
        setup(images: images)
    }

    required init(coder: NSCoder) {
        fatalError("init(coder:) has not been implemented")
    }

    private func setup(images: [UIImage]) {
        axis = .horizontal
        distribution = .fillEqually
        spacing = 0

        for image in images {
            let imageView = UIImageView(image: image)
            imageView.contentMode = .scaleAspectFit
            imageView.translatesAutoresizingMaskIntoConstraints = false
            addArrangedSubview(imageView)

            NSLayoutConstraint.activate([
                imageView.widthAnchor.constraint(equalTo: widthAnchor, multiplier: iconScale),
                imageView.heightAnchor.constraint(equalTo: heightAnchor, multiplier: iconScale)
            ])
        }
    }
}
```

