  .then(convertedAmount => {
    console.log(`${amount} ${fromCurrency} is equal to ${convertedAmount} ${toCurrency}`);
  })
  .catch(error => {
    console.error(error);
  });
```
In this example, we're using the `axios` library to make a GET request to the Open Exchange Rates API. We pass in our API key as a query parameter and receive a response containing the latest exchange rates.

