Creating a Swift struct version of the Metal Shading Language's abstract syntax tree (AST) is a complex task that involves understanding both the Metal Shading Language and Swift programming language. Here's a simplified example of how you might start to represent a small subset of the Metal Shading Language AST in Swift.

```swift
// Define a protocol for all AST nodes
protocol ASTNode {
    func accept(visitor: ASTVisitor)
}

// Define a protocol for an AST visitor
protocol ASTVisitor {
    func visit(node: FunctionDeclaration)
    func visit(node: VariableDeclaration)
    // Add more methods for other AST nodes
}

// Define a struct for a function declaration
struct FunctionDeclaration: ASTNode {
    let name: String
    let returnType: String
    let parameters: [VariableDeclaration]

    func accept(visitor: ASTVisitor) {
        visitor.visit(node: self)
    }
}

// Define a struct for a variable declaration
struct VariableDeclaration: ASTNode {
    let name: String
    let type: String

    func accept(visitor: ASTVisitor) {
        visitor.visit(node: self)
    }
}
```

This is a very simplified example and does not cover the full complexity of the Metal Shading Language or ASTs in general. For a full implementation, you would need to define structs for all the different types of nodes in the AST, and implement the `ASTVisitor` protocol to perform operations on the AST.

Also, please note that Swift and Metal Shading Language have different type systems and features, so a direct 1-to-1 mapping may not always be possible or desirable.

