Here's a simple function that calculates the elapsed time since a post was made and returns it in a human-readable format. This function assumes that the input is a Date object representing the time the post was made.

```typescript
function getElapsedTime(postDate: Date): string {
  const currentDate = new Date();
  const elapsedMilliseconds = currentDate.getTime() - postDate.getTime();

  const seconds = Math.floor((elapsedMilliseconds / 1000) % 60);
  const minutes = Math.floor((elapsedMilliseconds / (1000 * 60)) % 60);
  const hours = Math.floor((elapsedMilliseconds / (1000 * 60 * 60)) % 24);
  const days = Math.floor(elapsedMilliseconds / (1000 * 60 * 60 * 24));

  if (days > 0) {
    return `${days} day(s) ago`;
  } else if (hours > 0) {
    return `${hours} hour(s) ago`;
  } else if (minutes > 0) {
    return `${minutes} minute(s) ago`;
  } else {
    return `${seconds} second(s) ago`;
  }
}
```

This function first calculates the elapsed time in milliseconds since the post was made. Then, it calculates the elapsed time in seconds, minutes, hours, and days. Finally, it returns a string representing the elapsed time in the largest unit that is greater than zero.

